package com.example.ss10_list_customer.repository;

import com.example.ss10_list_customer.model.Customer;
import java.util.ArrayList;
import java.util.List;

public class CustomerRepository implements ICustomerRepository{
  private static List<Customer> customerList;
  static {
    customerList = new ArrayList<>();
    customerList.add(new Customer("Thành Văn","01/01/2001","Đà nẵng","data:image/jpeg;base64,"));
    customerList.add(new Customer("Bảo lê","02/11/2001","Huế","data:image/jpeg;base64,"));
    customerList.add(new Customer("Lê văn độ","10/11/2002","Quảng Nam","data:image/jpeg;base64,"));
  }

  @Override
  public List<Customer> getAllCustomer() {
    return customerList;
  }
}
